def is_valid_position(track, px, py):
    try:
        if px < 0 or py < 0:
            return 0
        else:
            return track[px][py]!='x'
    except IndexError:
        return 0

def get_wall_distance(track_id, px, py, vx, vy):
    track = tracks[track_id]
    distance = 0
    while is_valid_position(track, px, py):
        px = px+vx
        py = py+vy
        distance = distance+1

    #print("Stopped at {}, {}".format(px, py))
    return distance

